"use client";
import React, { useState } from "react";
import { useRouter } from "next/navigation";
import axios from "axios";
import { useDispatch } from "react-redux";
import { logIn } from "@/redux/slices/UserSlice";
import Link from "next/link";
import { useForm } from "react-hook-form";
import { useToast } from "@/shadcn/ui/use-toast";
import Image from "next/image";
import loginTemp from '../assets/loginTemp.png'

const Login = () => {
  const [toggle, setToggle] = useState(false);
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const router = useRouter();

  const { toast } = useToast();

  const dispatch = useDispatch();

  const handleLogin = async (data) => {
    const email = data?.email;
    const password = data?.password;
    // console.log(toggle);
    // false -> freelancer
    if (email == "" || password == "") {
      toast({
        title: "Error: Login",
        description: "Please fill both inputs",
      });

      return;
    }
    try {
      const data = await axios.post("/api/login", {
        email,
        password,
        toggle
      });


      const newData = {
        status: data.status,
        userDoc: data?.data?.userDoc,
      };
      if (data.status == 200) {
        console.log(newData);
      }
      // console.log(data);
      localStorage.clear();
      localStorage.setItem("accessToken", JSON.stringify(newData));

      dispatch(logIn(newData));
      router.push("/");
    } catch (error) {
      if(error?.response?.data){
        toast({
          title: "Error: Login",
          description: error?.response?.data?.user,
        });
      }
      else{
        toast({
          title: "Error: Login",
          description: "Password or email doesn't match",
        });
      }

      console.log(error);
    }
  };

  return (
    <>
  

      <section className="h-screen">
        <div className="container h-full px-6 py-24">
          <div className="g-6 flex h-full flex-wrap items-center justify-center lg:justify-between">
            <div className="mb-12 md:mb-0 md:w-8/12 lg:w-6/12">
         
              {toggle ? (
                <>
                  <Image src={loginTemp} alt="login temp" className="hidden md:block" width={550} height={550}/>
                </>
              ) : (
                <>
                <svg
                    viewBox="0 0 716 734"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                  >
                    <rect
                      x={-35}
                      width={600}
                      height={600}
                      rx={17}
                      fill="url(#pattern0)"
                    />
                    <defs>
                      <pattern
                        id="pattern0"
                        patternContentUnits="objectBoundingBox"
                        width={1}
                        height={1}
                      >
                        <use
                          xlinkHref="#image0_22_50"
                          transform="matrix(0.00134253 0 0 0.00137363 -0.693276 -0.0156994)"
                        />
                      </pattern>
                      <image
                        id="image0_22_50"
                        width={1800}
                        height={728}
                        xlinkHref="data:image/png;base64,"
                      />
                    </defs>
                  </svg>
                </>
              )}
            </div>
            <div className="md:w-8/12 lg:ml-6 lg:w-5/12">
              <label className="relative inline-flex items-center cursor-pointer mb-10">
                <input
                  type="checkbox"
                  value=""
                  className="sr-only peer"
                  checked={toggle}
                  onChange={(e) => setToggle(!toggle)}
                />
                <div className="w-11 h-6 bg-blue-200 rounded-full peer peer-focus:ring-4 peer-focus:ring-ring-300 dark:peer-focus:ring-blue-800 dark:bg-gray-700 peer-checked:after:translate-x-full rtl:peer-checked:after:-translate-x-full peer-checked:after:border-white after:content-[''] after:absolute after:top-0.5 after:start-[2px] after:bg-white after:border-gray-300 after:border after:rounded-full after:h-5 after:w-5 after:transition-all dark:border-gray-600 peer-checked:bg-red-600"></div>
                <span className="ms-3 text-sm font-medium text-gray-900 dark:text-gray-300">
                  {toggle ? "I'm a Recruiter" : "I'm a Freelancer"}
                </span>
              </label>

              <div className="relative mb-4" data-te-input-wrapper-init>
                <label
                  htmlFor="email"
                  className="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
                >
                  Your email
                </label>

                <input
                  type="text"
                  className="peer block min-h-[auto] w-full rounded border-2 bg-transparent px-3 py-[0.32rem] leading-[1.6] outline-none transition-all duration-200 ease-linear border-gray-200   "
                  id="exampleFormControlInput1"
                  {...register("email")}
                />
              </div>
              <div className="relative mb-4" data-te-input-wrapper-init>
                <label
                  htmlFor="email"
                  className="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
                >
                  Your Password
                </label>

                <input
                  type="password"
                  className="peer block min-h-[auto] w-full rounded border-2 border-gray-200  bg-transparent px-3 py-[0.32rem] leading-[1.6] outline-none transition-all duration-200 ease-linear   "
                  id="exampleFormControlInput1"
                  {...register("password")}
                />
              </div>
              <div className="mb-6 flex items-center justify-between">
                <a
                  href="#!"
                  className="text-sky-300 transition duration-150 ease-in-out hover:text-sky-500 focus:text-sky-300"
                >
                  Forgot password?
                </a>
              </div>
              <button
                type="submit"
                className={`inline-block  rounded  ${toggle?"bg-[#FC1010]":"bg-[#2F00E9]"}  px-7 pb-2.5 pt-3 text-sm font-medium uppercase leading-normal text-white shadow-[0_4px_9px_-4px_#3b71ca] transition duration-150 ease-in-out hover:bg-primary-600  hover:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.3),0_4px_18px_0_rgba(59,113,202,0.2)] focus:bg-primary-600 focus:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.3),0_4px_18px_0_rgba(59,113,202,0.2)] focus:outline-none focus:ring-0 active:bg-primary-700 active:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.3),0_4px_18px_0_rgba(59,113,202,0.2)] dark:shadow-[0_4px_9px_-4px_rgba(59,113,202,0.5)] dark:hover:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.2),0_4px_18px_0_rgba(59,113,202,0.1)] dark:focus:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.2),0_4px_18px_0_rgba(59,113,202,0.1)] dark:active:shadow-[0_8px_9px_-4px_rgba(59,113,202,0.2),0_4px_18px_0_rgba(59,113,202,0.1)] `}
                data-te-ripple-init
                data-te-ripple-color="light"
                onClick={handleSubmit(handleLogin)}
              >
                Log in
              </button>
              <div className="mb-6 flex mt-3 items-center justify-between">
                <p
                  className="text-sky-300"
                >
                  Doesn&apos;t have an account?
                   <Link href='/register' className=" text-white cursor-pointer transition duration-150 ease-in-out hover:text-sky-500 focus:text-sky-300 ml-8 bg-yellow-400 p-2 rounded-md">
                   Register
                  </Link>
                </p>
              </div>
              <div className="mt-10 font-bold dark:text-white text-4xl">Get the best Gigs</div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Login;
